function Login() {
    return (
        <>
            <div className="container">
                <div>
                    <div className="">
                        <h2>SELAMAT DATANG DIINPUT DATA</h2>
                    </div>
                </div>
                <div>
                    <FooterAdmin />
                </div>
            </div>
        </>
    )
}

export default Login;
